import { Link } from 'react-router-dom'

function Rule() {
  return (
    <div>
        <Link to="/game">
            <button type="button">
                Click Me!
            </button>
        </Link>
        <h1>This is Rule page</h1>
    </div>
  );
}

export default Rule;
